import React, { useState } from 'react'

export const Hilfe = () => {
    const [text,setText] = useState()
    const inhalt = 'Epsilorumequorum'
    let pressed = true
    function openHelp(){
        if(pressed){
            setText(        
                <p>
                    {inhalt}
                </p>
            )
        }
        else{
            setText(
                <p>
                    {inhalt}
                </p>
            )
        }
        pressed = !pressed
    }
  return (
    <div>
        <button id='help' onClick={openHelp}>HELP</button>
        <p>
            {text}
        </p>
    </div>
  )
}
